import Dropdown from 'react-bootstrap/Dropdown';

function ReferenceMenu() {
  return (
    <Dropdown>
      <Dropdown.Toggle variant="success" id="dropdown-basic">
        Dropdown Button
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item href="/references/sections/doors">Dør og Vindu</Dropdown.Item>
        <Dropdown.Item href="/references/sections/bathroom">Another action</Dropdown.Item>
        <Dropdown.Item href="/references/sections/rehab">Something else</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
}

export default ReferenceMenu;




